import emotion from "@emotion/styled";
const transientOptions = {
    shouldForwardProp: (propName) => !propName.startsWith("$"),
};
const styled = (tag, options) => {
    return emotion(tag, { ...transientOptions, ...(options || {}) });
};
export default styled;
